@snowbirds why is it 1 gb when others were 300ish mb?


Even 1GB for 720p is quite less, 300ish and 720p is not possible except if we are talking for really shitty quality - Usually 720p is about 4-6GB and 1080 is about 8-10GB for good quality on standar H263(e.g. Xvid, DivX, MPEG4 etc).. now with H264(e.g. x264, MPEG4-AVC) these numbers are way less

Source: Ex transcoder/encoder (no sources or time to encoding anything useful :))
